import React, { useState } from "react";
import Search from '../components/Search';

const Index = () => {
  const style={
    width:'100vw',
    height:'100vh',
    display: 'flex',
    justifyContent:'center',
    alignItems:'center',
    background: rgb(145,145,154)
  }
  return (
    <div style={style}>
      <Search />
    </div>
  );
};

export default Index;
